// ==UserScript==
// @name           Extra info on iCheckMovies
// @namespace      http://diveintogreasemonkey.org/download/
// @include        http://www.icheckmovies.com/lists/*
// @include        http://www.icheckmovies.com/movies/*
// @exclude        http://www.icheckmovies.com/lists/*/topusers/
// @exclude        http://www.icheckmovies.com/lists/
// @exclude        http://www.icheckmovies.com/lists/?*
// @exclude        http://www.icheckmovies.com/lists/disliked/
// @exclude        http://www.icheckmovies.com/lists/watchlist/
// ==/UserScript==
var runtime;
var rating;
var sps = new Array(3000);
var webs1 = new Array(3000);
var it1=0;
var allLinks, thisLink;
allLinks = document.evaluate(
                             '//li',
                             document,
                             null,
                             XPathResult.UNORDERED_NODE_SNAPSHOT_TYPE,
                             null);
var x=0;
var extraInfo=1;
var url = document.URL;
url = url.substring(28,33);

for (var i=0; i < allLinks.snapshotLength;i++)
{
	thisLink = allLinks.snapshotItem(i);
	if(thisLink.getAttribute('class')!=null && 
       thisLink.getAttribute('class').substring(0, 17)=='listItem listItem')
	{
		
        if(extraInfo==1)
        {
            var title = thisLink.getElementsByTagName('h2')[0].getElementsByTagName('a')[0].innerHTML;
            lis = thisLink.getElementsByTagName('ul')[1].getElementsByTagName('li');
            if (url=='lists')
                sps[it1] = thisLink.getElementsByTagName('span')[2]; 
            else
                sps[it1] = thisLink.getElementsByTagName('span')[0];
            sps[it1].innerHTML = sps[it1].innerHTML + ' - Loading extra info...';
            
            var website = '';
            for (var j=0; j < lis.length; j++)
            {
                if(lis[j].getElementsByTagName('a')[0].getAttribute('class')=='optionIcon optionIMDB external')
                {
                    website = lis[j].getElementsByTagName('a')[0].href;
                }
            }
            webs1[it1] = website;
            it1++;
            
            GM_xmlhttpRequest({
                              method: "GET",
                              url: website,
                              onload: function(responseDetails) {
                              
                              resp = responseDetails.responseText.toString();
                              
                              time = resp.indexOf('<time itemprop="dura');
                              time = time+5;
                              time1 = resp.indexOf('>', time)+1;
                              time2 = resp.indexOf('<', time);
                              if(time2-time1!=1)
                              {
                                  runtime = resp.substring(time1,time2);
                              }
                              else
                              {
                                  time = resp.indexOf('<div class="infobar">');
                                  time = time+5;
                                  time1 = resp.indexOf('>', time)+3;
                                  time2 = resp.indexOf('min', time)+3;
                                  altruntime = resp.substring(time1,time2);
                                  if(altruntime.indexOf('min')>10 || altruntime.indexOf('min')==-1)
                                      altruntime = 'N/A';
                                  runtime = altruntime;
                              }
                              
                              divrate = resp.indexOf('<div class="titlePageSprite star-box-giga-star">');
                              divrate1 = resp.indexOf('>', divrate+1)+2;
                              divrate2 = resp.indexOf('<', divrate+1);
                              rating = resp.substring(divrate1,divrate2);
                              
                              metac = resp.indexOf('property="og:url"');
                              metac1 = resp.indexOf('content="', metac)+9;
                              metac2 = resp.indexOf('/"', metac)+1;
                              web = resp.substring(metac1,metac2);
                              
                              for(var j=0; j<it1; j++)
                              {
                              if(web==webs1[j])
                              sps[j].innerHTML = sps[j].innerHTML.substring(0, 
                                                                            sps[j].innerHTML.indexOf(' - Loading extra info...')) + 
                              ' - ' + rating + ' - ' + runtime;
                              }
                              },
                              onerror: function(responseDetails) {
                              for(var j=0; j<it1; j++)
                              {
                              sps[j].innerHTML = sps[j].innerHTML.substring(0, 
                                                                            sps[j].innerHTML.indexOf(' - Loading extra info...')) + 
                              ' - Imdb connection error';
                              }
                              }
                              });
        }
		
		// ::::::::::::::::: Youtube Button :::::::::::::::::
		var tubelink = document.createElement('a');
		tubelink.href = 'http://www.youtube.com/results?search_query=' + title;
		tubelink.title = 'Search in YouTube';
		tubelink.target = '_blank';
		tubelink.style.textAlign = 'right';
		tubelink.style.marginRight = '8px';
		tubelink.addEventListener('mouseover', youtube_onMouseOver, false);
		tubelink.addEventListener('mouseout', youtube_onMouseOut, false);
		
		var imgtube = document.createElement('img');
		imgtube.src = 'data:image/png;base64,';
		imgtube.style.border = 'none';
		imgtube.style.height = '10px';
		imgtube.style.offsetTop = '10px';
		tubelink.appendChild(imgtube);
		// :::::::::::::::::::::::::::::::::::::::::::::::::::
		
		// ::::::::::::::::: Isohunt Button :::::::::::::::::
		var isolink = document.createElement('a');
		isolink.href = 'http://isohunt.com/torrents/' + title + '?iht=-1&ihp=1&ihs1=1&iho1=d';
		isolink.title = 'Search in Isohunt';
		isolink.target = '_blank';
		isolink.style.textAlign = 'right';
		isolink.style.marginRight = '8px';
		isolink.addEventListener('mouseover', isohunt_onMouseOver, false);
		isolink.addEventListener('mouseout', isohunt_onMouseOut, false);
		
		var isoImg = document.createElement('img');
		isoImg.src = 'data:image/png;base64,%3D';
		isoImg.style.border = 'none';
		isoImg.style.height = '10px';
		isoImg.style.offsetTop = '10px';
		isolink.appendChild(isoImg);
		// ::::::::::::::::::::::::::::::::::::::::::::::::::
		
		// ::::::::::::::::: PirateBay Button :::::::::::::::::
		var pirlink = document.createElement('a');
		pirlink.href = 'http://thepiratebay.org/search/' + title + '/0/7/0';
		pirlink.title = 'Search in PirateBay';
		pirlink.target = '_blank';
		pirlink.style.textAlign = 'right';
		pirlink.style.marginRight = '8px';
		pirlink.addEventListener('mouseover', pirate_onMouseOver, false);
		pirlink.addEventListener('mouseout', pirate_onMouseOut, false);
		
		var pirImg = document.createElement('img');
		pirImg.src = 'data:image/png;base64,%3D%3D';
		pirImg.style.border = 'none';
		pirImg.style.height = '10px';
		pirImg.style.offsetTop = '10px';
		pirlink.appendChild(pirImg);
		// ::::::::::::::::::::::::::::::::::::::::::::::::::
		
		// ::::::::::::::::: ETA Button :::::::::::::::::
		var etalink = document.createElement('a');
		etalink.href = 'http://videoeta.com/search/?search_query=' + title;
		etalink.title = 'Find out when the DVD is released on Video ETA';
		etalink.target = '_blank';
		etalink.style.textAlign = 'right';
		etalink.style.marginRight = '8px';
		etalink.addEventListener('mouseover', eta_onMouseOver, false);
		etalink.addEventListener('mouseout', eta_onMouseOut, false);
		
		var etaImg = document.createElement('img');
		etaImg.src = 'data:image/png;base64,%3D';
		etaImg.style.border = 'none';
		etaImg.style.height = '10px';
		etaImg.style.offsetTop = '10px';
		etalink.appendChild(etaImg);
		// ::::::::::::::::::::::::::::::::::::::::::::::::::
		
		// ::::::::::::::::: OS Button :::::::::::::::::
		var oslink = document.createElement('a');
		oslink.href = 'http://www.opensubtitles.org/pt/search2/sublanguageid-eng/moviename-' + title;
		oslink.title = 'Search in OpenSubtitles';
		oslink.target = '_blank';
		oslink.style.textAlign = 'right';
		oslink.style.marginRight = '8px';
		oslink.addEventListener('mouseover', os_onMouseOver, false);
		oslink.addEventListener('mouseout', os_onMouseOut, false);
		
		var osImg = document.createElement('img');
		osImg.src = 'data:image/png;base64,%3D';
		osImg.style.border = 'none';
		osImg.style.height = '10px';
		osImg.style.offsetTop = '10px';
		oslink.appendChild(osImg);
		// ::::::::::::::::::::::::::::::::::::::::::::::::::
		
		// ::::::::::::::::: OS Button :::::::::::::::::
		var gglink = document.createElement('a');
		gglink.href = 'https://www.google.com/search?q=' + title;
		gglink.title = 'Search in Google';
		gglink.target = '_blank';
		gglink.style.textAlign = 'right';
		gglink.style.marginRight = '8px';
		gglink.addEventListener('mouseover', gg_onMouseOver, false);
		gglink.addEventListener('mouseout', gg_onMouseOut, false);
		
		var ggImg = document.createElement('img');
		ggImg.src = 'data:image/png;base64,%3D';
		ggImg.style.border = 'none';
		ggImg.style.height = '10px';
		ggImg.style.offsetTop = '10px';
		gglink.appendChild(ggImg);
		// ::::::::::::::::::::::::::::::::::::::::::::::::::
        
		h = thisLink.getElementsByTagName('ul')[1].getElementsByTagName('li')[0];
		h.parentNode.insertBefore(tubelink, h.nextSibling);
		h.parentNode.insertBefore(gglink, h.nextSibling);
		h.parentNode.insertBefore(etalink, h.nextSibling);
		h.parentNode.insertBefore(oslink, h.nextSibling);
		h.parentNode.insertBefore(isolink, h.nextSibling);
		h.parentNode.insertBefore(pirlink, h.nextSibling);
	}
	
}
function youtube_onMouseOver()
{
	im = this.getElementsByTagName('img')[0];
	im.src = 'data:image/png;base64,';
}
function youtube_onMouseOut()
{
	im = this.getElementsByTagName('img')[0];
	im.src = 'data:image/png;base64,';
}
function isohunt_onMouseOver()
{
	im = this.getElementsByTagName('img')[0];
	im.src = 'data:image/png;base64,';
}
function isohunt_onMouseOut()
{
	im = this.getElementsByTagName('img')[0];
	im.src = 'data:image/png;base64,%3D';
}
function pirate_onMouseOver()
{
	im = this.getElementsByTagName('img')[0];
	im.src = 'data:image/png;base64,%3D%3D';
}
function pirate_onMouseOut()
{
	im = this.getElementsByTagName('img')[0];
	im.src = 'data:image/png;base64,%3D%3D';
}
function eta_onMouseOver()
{
	im = this.getElementsByTagName('img')[0];
	im.src = 'data:image/png;base64,';
}
function eta_onMouseOut()
{
	im = this.getElementsByTagName('img')[0];
	im.src = 'data:image/png;base64,%3D';
}
function os_onMouseOver()
{
	im = this.getElementsByTagName('img')[0];
	im.src = 'data:image/png;base64,%3D%3D';
}
function os_onMouseOut()
{
	im = this.getElementsByTagName('img')[0];
	im.src = 'data:image/png;base64,%3D';
}
function gg_onMouseOver()
{
	im = this.getElementsByTagName('img')[0];
	im.src = 'data:image/png;base64,';
}
function gg_onMouseOut()
{
	im = this.getElementsByTagName('img')[0];
	im.src = 'data:image/png;base64,%3D';
}